--

CREATE TABLE `y1adk_dpcalendar_events` (
  `id` int(10) UNSIGNED NOT NULL,
  `catid` varchar(255) NOT NULL DEFAULT '0',
  `uid` varchar(255) NOT NULL DEFAULT '',
